#include <koinos/chain/rectify.hpp>

#include <koinos/chain/state.hpp>
#include <koinos/util/base64.hpp>
#include <koinos/util/hex.hpp>

#include <google/protobuf/util/json_util.h>

namespace koinos::chain {

void maybe_rectify_state( execution_context& ctx, const protocol::block& block, protocol::block_receipt& block_receipt )
{
  if( block.header().height() == 9'180'357
      && block.id()
           == util::from_hex< std::string >(
             "0x1220f66b60a65c8614eda8b70a03df13a6f53a2089111dc6eed1a286d879d22e84b4" ) )
  {
    block_receipt.set_compute_bandwidth_used( 17'631'052 );
    block_receipt.set_compute_bandwidth_charged( 17'557'631 );
    block_receipt.mutable_transaction_receipts( 0 )->set_compute_bandwidth_used( 14'582'049 );
    block_receipt.mutable_transaction_receipts( 0 )->set_rc_used( 423'344'309 );

    auto block_node = ctx.get_state_node();

    object_space space;
    space.set_zone( util::from_base64< std::string >( "ALJp6C6zICjLRQ8DEj48TS+Rp8fr9OW8fA==" ) );
    space.set_system( true );

    auto* state_entry = block_receipt.mutable_state_delta_entries( 5 );
    state_entry->mutable_object_space()->set_zone( space.zone() );
    state_entry->mutable_object_space()->set_system( space.system() );
    state_entry->set_key( util::from_base64< std::string >( "bWFya2V0cw==" ) );
    state_entry->set_value(
      util::from_base64< std::string >( "Cg4IgdDQhB8YsLUCIICAIBIPCJThs6XNARiAgBAggIBAGhMI0beCnLHVAhjgwrUbIODNi4kB" ) );

    block_node->put_object( space, state_entry->key(), &state_entry->value() );

    space.set_zone( util::from_base64< std::string >( "AC4z/RqpB7IkzpzmyUIokB0oOgLalW2nkQ==" ) );
    space.set_id( 1 );
    space.set_system( true );

    state_entry = block_receipt.mutable_state_delta_entries( 63 );
    state_entry->mutable_object_space()->set_zone( space.zone() );
    state_entry->mutable_object_space()->set_id( space.id() );
    state_entry->mutable_object_space()->set_system( space.system() );
    state_entry->set_key( util::from_base64< std::string >( "ANAlFhI9x76hhWhfte5LvQ6NfFoHakTMtQ==" ) );
    state_entry->set_value( util::from_base64< std::string >( "CICOmsf2EhDLnKv99BIY2IHul64x" ) );
    auto* trx_state_entry = block_receipt.mutable_transaction_receipts( 0 )->mutable_state_delta_entries( 62 );
    *( trx_state_entry->mutable_object_space() ) = state_entry->object_space();
    trx_state_entry->set_key( state_entry->key() );
    trx_state_entry->set_value( state_entry->value() );

    block_node->put_object( space, state_entry->key(), &state_entry->value() );
  } else if ( block.header().timestamp() > 1761911880000
              && block.header().timestamp() < 1761912000000 )
  {
    // rectification to be applied between 2025-10-31T11:58:00 and 2025-10-31T12:00:00
    auto metadata_space = state::space::contract_metadata();
    auto bytecode_space = state::space::contract_bytecode();

    // Koinos Fund contract mainnet (address 1A5BmMqV5jN5zBrdkhQumAfDZBzXLPBeN9)
    auto key = util::from_base64< std::string >( "AGODyCuhi5XqbJWB30tP4BYEWmCH6mq2zg==" );

    // koinos fund hash mainnet
    auto new_koinos_fund_hash = util::from_hex< std::string >( "0x12206d263c191b3a6d7cbd70e24fc5c62159f316f6ec115ba8796f269e2ce41d11aa" );

    // // koinos fund hash testnet
    // auto new_koinos_fund_hash = util::from_hex< std::string >( "0x1220374b5435f70f104f796816407b8bc072e9f727ec90f71fe8355e5bec9c5e2425" );

    auto block_node = ctx.get_state_node();

    auto existing_metadata_object = block_node->get_object( metadata_space, key );
    if( existing_metadata_object )
    {
      auto existing_contract_meta = util::converter::to< contract_metadata_object >( *existing_metadata_object );

      if( existing_contract_meta.hash() != new_koinos_fund_hash )
      {
        // new bytecode for koinos fund in mainnet
        auto new_bytecode = util::from_base64< std::string >( "" );

        // new bytecode for koinos fund in testnet
        // auto new_bytecode = util::from_base64< std::string >( "" );

        // Add state delta entry to block receipt
        auto* state_entry = block_receipt.add_state_delta_entries();
        state_entry->mutable_object_space()->set_zone( bytecode_space.zone() );
        state_entry->mutable_object_space()->set_system( bytecode_space.system() );
        state_entry->mutable_object_space()->set_id( bytecode_space.id() );
        state_entry->set_key( key );
        state_entry->set_value( new_bytecode );

        // update bytecode
        block_node->put_object( bytecode_space, key, &new_bytecode );

        // create the contract metadata object
        contract_metadata_object contract_meta;
        contract_meta.set_hash( new_koinos_fund_hash );
        contract_meta.set_system( true );
        contract_meta.set_authorizes_call_contract( true );
        contract_meta.set_authorizes_transaction_application( true );
        contract_meta.set_authorizes_upload_contract( true );
        auto metadata_value = util::converter::as< std::string >( contract_meta );

        // Add state delta entry for contract metadata
        auto* metadata_state_entry = block_receipt.add_state_delta_entries();
        metadata_state_entry->mutable_object_space()->set_zone( metadata_space.zone() );
        metadata_state_entry->mutable_object_space()->set_system( metadata_space.system() );
        metadata_state_entry->mutable_object_space()->set_id( metadata_space.id() );
        metadata_state_entry->set_key( key );
        metadata_state_entry->set_value( metadata_value );

        // update metadata
        block_node->put_object( metadata_space, key, &metadata_value );
      }
    }
  }
}

} // namespace koinos::chain
